    #section5 {
      margin-top: 140px;
      display: flex;
      flex-direction: row;
      justify-content: space-evenly;
      flex-wrap: wrap;
      visibility: collapse;
    }
    .Sdemo path {
      stroke-width: 15;
      fill-opacity: 0;
    }

    .sana {
      position: absolute;
      top: 30%;
      left: 5%;
      opacity: 0;
      z-index: 1;
    }
    .sana-container {
      height: 600px;
      width: 600px;
      background-color: black;
      position: absolute;
      overflow: hidden;
      cursor: pointer;
      top: 10px;
      left: 10px;
      border-radius: 5%;
    }
    .Soten {
      width: 100px;
      height: 100px;
    }

    .Sdemo {
      width: 100%;
      height: 100%;
    }

    .Sdiv-hue {
      opacity: 0;
      width: 620px;
      height: 620px;
      position: relative;
      background-color: #fa8bff;
      background-image: linear-gradient(135deg, #b210ff 10%, #eece13 100%);
      border-radius: 5%;
    }

    #jdm {
      cursor: pointer;
    }
    #itzy-div {
      height: 600px;
      width: 600px;
      background-color: black;
      position: absolute;
      top: 10px;
      left: 10px;
      border-radius: 5%;
      cursor: pointer;
    }

    .Jdiv-hue {
      width: 620px;
      height: 620px;
      position: relative;
      background-image: linear-gradient(135deg, #eece13 10%, #b210ff 100%);
      border-radius: 5%;
      opacity: 0;
    }

    .rose-div {
      width: 600px;
      height: 600px;
      background-color: black;
      overflow: hidden;
      cursor: pointer;
      position: absolute;
      top: 10px;
      left: 10px;
      border-radius: 5%;
    }

    .Rdiv-hue {
      width: 620px;
      height: 620px;
      position: relative;
      background-image: linear-gradient(135deg, #ffa8a8 10%, #fcff00 100%);
      border-radius: 5%;
      opacity: 0;
    }

    body {
      margin: 0;
      background-color: black;
    }

    <script
      src="https://cdnjs.cloudflare.com/ajax/libs/gsap/3.11.3/gsap.min.js"
      integrity="sha512-gmwBmiTVER57N3jYS3LinA9eb8aHrJua5iQD7yqYCKa5x6Jjc7VDVaEA0je0Lu0bP9j7tEjV3+1qUm6loO99Kw=="
      crossorigin="anonymous"
      referrerpolicy="no-referrer"
    ></script>
    <script>
      gsap.set('.Sdiv-hue', { opacity: 1 })
      const Scurve = document.querySelector('#Spota')
      const Sclick = document.querySelector('.sana-container')

      let length = Scurve.getTotalLength()
      console.log(length)

      gsap.set(Scurve, {
        strokeDasharray: length,
        strokeDashoffset: length,
        stroke: '#dc51dc',
        strokeWidth: 3,
      })

      let Sntl = gsap
        .timeline({ paused: true })

        .to(Scurve, { strokeDashoffset: 0, duration: 9, ease: 'linear' })
        .to(Scurve, { fillOpacity: 1, duration: 6 }, '-=7')
        .to(
          '#Sg2 path',
          { fillOpacity: 1, fill: 'violet', stagger: 0.2 },
          '-=7'
        )
        .to('#Sg2 path', { strokeWidth: 3 }, '-=8')
        .to('.Sdemo path', { strokeWidth: 3 }, '-=4')
        .to('#Sg2 path', { fill: 'black', ease: 'sine.out' }, '<')
        .to('.Sdemo', { backgroundColor: 'white', ease: 'sine.out' }, '<')
        .to('#Spota', { strokeWidth: 0, duration: 0.5, ease: 'linear' }, '<')

      Sclick.addEventListener('click', () => Sntl.play(!Sntl.play()))
    </script>
    <script>
      const dots = gsap.utils.toArray('#rose path')
      const rdd = document.querySelector('.rose-div')

      gsap.set('.Rdiv-hue', { opacity: 1 })
      gsap.set(rdd, { opacity: 1 })

      dots.forEach((dot, index) => {
        let length = dot.getTotalLength()
        console.log(length)
        gsap.set(dot, {
          strokeDasharray: length,
          strokeDashoffset: length,
          stroke: '#eece13',
          strokeWidth: 4,
          fillOpacity: 0,
        })

        const tl = gsap
          .timeline({ paused: true })
          .to(dot, { duration: 10, strokeDashoffset: 0, ease: 'linear' })

        rdd.addEventListener('click', () => tl.play(!tl.play()))
      })

      const ol = gsap
        .timeline({ paused: true })
        .to('#rose path', {
          stagger: { each: 0.003 },
          fillOpacity: 1,
          ease: 'sine.in',
        })
        .to('#rose path', {
          strokeWidth: 1,
          stroke: '#000000',
          strokeOpacity: 0,
          duration: 1,
          ease: 'sine.in',
        })

        .to(rdd, { backgroundColor: '#c9c9c9' }, '<')

      rdd.addEventListener('click', () => ol.play(!ol.play()))
    </script>

    <script>
      const izp = gsap.utils.toArray('#itzy path')
      const izd = document.querySelector('#izdemo')
      gsap.set('#section5', { autoAlpha: 1 })
      gsap.set('.Jdiv-hue', { opacity: 1 })
      gsap.set(izp, { fillOpacity: 0 })
      gsap.set(izd, { autoAlpha: 1 })

      izp.forEach((dot, index) => {
        let close = dot.querySelector('#reverse')
        const izd = document.querySelector('#izdemo')
        let length = dot.getTotalLength()
        console.log(length)
        gsap.set(dot, {
          strokeDasharray: length,
          strokeDashoffset: length,
          strokeWidth: 5,
        })

        const itzt = gsap.timeline({ paused: true }).to(dot, {
          duration: 10,
          strokeDashoffset: 0,
          ease: 'linear',
          stagger: 0.001,
        })

        izd.addEventListener('click', () => itzt.play(!itzt.play()))
      })

      const itzyt = gsap
        .timeline({ paused: true })
        .to(izp, { fillOpacity: 1, stagger: 0.006, ease: 'sine.in' })
        .to(
          izd,
          { backgroundColor: 'black', ease: 'sine.in', duration: 0.5 },
          '-=0.5'
        )

      izd.addEventListener('click', () => itzyt.play(!itzyt.play()))
    </script>
